MongoDB Motor - Cannot $push into nested array using variables<p>I am trying to update a nested array in my mongodb document, and I cant figure out how to <code>$push</code> using variables in such a nested array. The <a href="https://docs.mongodb.com/manual/tutorial/query-embedded-documents/" rel="nofollow noreferrer">docs</a> say to use the dot notation but I cant use that since I have different <code>key</code> and <code>node_id</code> against which I need to <code>$push</code></p>
<pre><code>for key, value in docs.items():
    print(f'Key: {key} Value: {value}')
    for node_id, timestamp in value.items():
    result = await db[collection].update_one({'user_id': user_id, 'date': date}, {'$push':{&quot;key.node_id&quot;: timestamp}}, upsert=True)
return result.modified_count
</code></pre>
<p><code>value</code> is a nested dictionary inside <code>docs</code>. Using the above code just updates the document with <code>str 'key'</code> and <code>'node_id'</code>. How do I access variables using dot notation in this case?</p>
<p>UPDATE:</p>
<p>This is a sample document that I am trying to build</p>
<pre><code>{
  &quot;date&quot;: &quot;18/04/2020&quot;,
  &quot;user_id&quot;: &quot;my_user&quot;,
  &quot;standing&quot;: [
    { &quot;2&quot;: [1582805181, 1582805183] },
    { &quot;3&quot;: [1582805181, 1582805183] }
  ],
  &quot;sitting&quot;: [
    { &quot;2&quot;: [1582805181, 1582805183] },
    { &quot;3&quot;: [1582805181, 1582805183] }
  ],
  &quot;walking&quot;: [
    { &quot;2&quot;: [1582805181, 1582805183] },
    { &quot;3&quot;: [1582805181, 1582805183] }
  ]
}
</code></pre>
<p>Update 2:</p>
<p><code>key</code> will be either one of three sitting, standing, walking. <code>value</code> is a nested dictionary in docs whose keys can be 2 or 3 - <code>node_id</code> in this case and <code>timestamp</code> will be a unix timestamp of 10 digits.</p>

