Using a custom serializer in MongoDB for a nested object interferes with filters using that object<p>I have models defined like below (I ommited parts not directly related to the problem):</p>

<pre><code>public class AnObjectWithState {
    public AbstractState State { get; private set; }
}

public abstract class AbstractState {
    public State Representation { get; protected set; }
}

public enum State {
    State1,
    State2,
    State3
}
</code></pre>

<p>And the serializer code:</p>

<pre><code>public class AbstractStateSerializer : SerializerBase&lt;AbstractState&gt;
{
    public override AbstractState Deserialize(BsonDeserializationContext context, BsonDeserializationArgs args) =&gt;
        StateFactory.CreateFor(base.Deserialize(context, args));
}
</code></pre>

<p>And this code is what I use to register the serializer: </p>

<pre><code>cm.MapField(c =&gt; c.State).SetSerializer(new AbstractStateSerializer());
</code></pre>

<p>Now, when I issue a count query agains my MongoDB instance, I get an error saying:</p>

<blockquote>
  <p>System.InvalidOperationException :
  Convert({document}{State}.Representation, Int32) is not supported.</p>
</blockquote>

<p>It's obvious that the serializer is to blame, because when I remove the <code>SetSerializer</code> call everything works fine. You may say that what I'm doing looks weird, however please understand that this <code>AbstractState</code> implementation above is the minimal version - in reality it has a bit more code and that code needs to be initialized in a way that MongoDB can't operate. My goal here is to have a clean aggregate - holding only the business logic and not the construction logic. That's why I'd rather have some infrastructural code in place (like that custom serializer) to initialize the state object. Any ideas on how to make it work?</p>

