How to use MongoDB change streams with node js via a REST API microservice (built with Express)<p>I'm using react js for building frontend for a website. An express server (which is a microservice) sits in between the front end and MongoDB. I make Axios calls from react js to express server (URL = <a href="http://localhost:5688/chat" rel="nofollow noreferrer">http://localhost:5688/chat</a> ) using GET, POST, PUT whenever and wherever needed.</p>

<p>something like below</p>

<h3>Client side</h3>

<pre><code>var resp = axios.get(`http://localhost:5688/chat`);
resp.then((response) =&gt; {
this.setState({data: response.data})
})
</code></pre>

<h3>Server side</h3>

<p>app.js</p>

<pre><code>var app = express();

app.get('/chat', function (req, res) {
    try {
        var MongoClient = require('mongodb').MongoClient;
        var url = '***********';
        MongoClient.connect(url, { useUnifiedTopology: true }, function(err, client) {
             if (err){
                console.log('error occured while connection to databse ' + err);
             }
             else{
                db.collection(collectionName).find({}).toArray(function(err, result){
                    if (err) {throw err;}
                    else{
                        client.close();
                        res.join(result); // the result would contain the data fetch from db and will be returned to my axios call
                    }
                });
            }
        });
    }
    catch (ex) {
        res.json(ex);
    }
});

app.listen(5688, function(){
    console.log('Server listening at http://localhost:5688');
});
</code></pre>

<p>Above is how I've implemented a GET call. Similarly, I've implemented POST and PUT methods as well.</p>

<p>PS: I removed a lot of intermediate code which is not very helpful for this question</p>

<p>Now I want to use <a href="https://www.mongodb.com/blog/post/five-minute-mongodb--change-streams-and-mongodb-4x" rel="nofollow noreferrer">MongoDB change stream</a> to listen to all changes that happen to my collection on MongoDB. I'm aware of the tutorials that show how we can log the updated documents in the express server.....such as this <a href="https://thecodebarbarian.com/a-nodejs-perspective-on-mongodb-36-change-streams.html" rel="nofollow noreferrer">tutorial</a>. This makes it possible for my express server to get all the updated documents whenever data in my DB is changed. </p>

<p>But what I'm not sure about is how I can pass this new data to my client so that I can update my react component's state with this new data. </p>

<p>How do I make my frontend code sitting in my browser continuously listen to my express server (a REST API) which is already continuously listening to all changes in MongoDB with the help of change streams?</p>

<p>Is socket the only way to make my client continuously listen to my server? if so, how would I pass the new data coming from MongoDB streaming to the socket on the express server</p>

<p>Please let me know if I should provide more details. Thank you so much.</p>

