Mogoose: Check if fields exist in schema before updating a document<p>I have a collection model like this: </p>

<pre class="lang-js prettyprint-override"><code>const Task = mongoose.model('Task', {
  description: {
    type: String,
    trim: true,
    required: true
  },
  completed: {
    type: Boolean,
    default: false
  }
})
</code></pre>

<p>Currently, When a user tries to update a document using the API, any field that is not in the schema will be ignored, and the document will be updated. I want to throw an error if the user sends an update request to the API with a field that is not available in the database.</p>

<p>if I have a task with id of <code>12345</code> in the database:</p>

<pre><code>{
  _id: 12345,
  description: "Buy cheese."
  completed: false
}
</code></pre>

<p>and a user sends an update query to the API for a the task:</p>

<pre class="lang-js prettyprint-override"><code>id = '12345'
updates = {
  description: 'Buy Milk',
  due: '1 Week' //&lt;-- Invalid Field
}
</code></pre>

<p>And I use this object to update the document:</p>

<pre class="lang-js prettyprint-override"><code>await Task.findByIdAndUpdate(id, updates)
</code></pre>

<p>mongoose completely ignores the invalid <code>due</code> field and updates the document with the new <code>description</code> field. </p>

<p>Is there a clean way to avoid this sort of invalid update requests?</p>

