Creating a document with { strict: false } in mongoose<p>The task is to store some documents into MongoDB. The documents have the same top-level but from there they could be different.
The structure of the payload is:</p>

<pre><code>{
  "types": "a", //the type can be "a", "b" or "c"
  "details" : {
       ... // the details object structure is different for each type
    }
}
</code></pre>

<p>and this is the model I wrote:</p>

<pre><code>const Details = { strict: false };

const MyOrder = new Schema({
  types: {
    type: String,
    enum: ['a', 'b', 'c'],
  },
  details: Details,
});

module.exports = Order = mongoose.model('myOrder', MyOrder);
</code></pre>

<p>I set details with <code>{ strict: false }</code> because I want to get its data no matter what structure it has. Maybe it's wrong something there.</p>

<p>When a POST request is done, the document saved into the database it looks like this:</p>

<pre><code>_id: ObjectId("...")
types: "a"
__v : 0
</code></pre>

<p>It saved the <code>types</code> but nothing about the details.</p>

<p>Is it a way to save the details too?</p>

